import { createTheme } from '@mui/material/styles';

const theme = createTheme({
    breakpoints: {
        values: {
            xs: 0,   // 'extra-small' breakpoint
            sm: 600, // 'small' breakpoint
            md: 900, // 'medium' breakpoint
            lg: 1200,// 'large' breakpoint
            xl: 1536 // 'extra-large' breakpoint
        }
    },
    components: {
        MuiContainer: {
            styleOverrides: {
                root: {
                    minWidth: '360px',
                    maxWidth: '1280px',
                    minHeight: '740px',
                    margin: '0 auto',
                },
            },
        },
    },
    palette: {
        primary: {
            main: '#302723',
        },
        secondary: {
            main: '#FAE100',
        },
        background: {
            default: '#FFFFFF',
        },
    },
    typography: {
        fontFamily: '"Nunito Sans", sans-serif',
        h1: {
            fontSize: '5vw',
            fontWeight: 700,
            color: '#464646',
        },
        body1: {
            fontSize: '1rem',
            fontWeight: 400,
        },
    },
});

export default theme;
